import './Addnote.css'
import {Textfit} from 'react-textfit'
import React from 'react';
function Note(props){
    return(
        <div className='add-taskbar'>
            <form action="/" method="GET">
                <input id="text-box" type="text" value={props.userTask} placeholder="Enter task" />
                <button id="submit-btn" type="submit" onClick = {props.onclick}>Add Note</button>
            </form>
        </div>
    )
}

export default Note;
